import React from "react";
import { Routes } from "react-router-dom";

import Home from "../pages/Home";
import Tours from "../pages/Tours";
import Login from "../pages/Login";
import Register from "../pages/Register";
import TourDetails from "../pages/TourDetails";
import ThankYou from "../pages/ThankYou";
import SearchResultList from "../pages/SearchResultList";
import AdminHome from "../pages/AdminHome";
import Users from "../pages/Users";
import Toursadmin from "../pages/Toursadmin";
import Bookings from "../pages/Bookings";
import Userbookings from "../pages/Userbookings";
import Profile from "../pages/Profile";
import ProtectedRoute from "./ProtectedRoute";

const Router = () => {
  return (
    <Routes>
      <ProtectedRoute path="/" element={<Home />} />
      <ProtectedRoute path="/home" element={<Home />} />
      <ProtectedRoute path="/tours" element={<Tours />} />
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <ProtectedRoute path="/tours/:id" element={<TourDetails />} />
      <ProtectedRoute path="/thank-you" element={<ThankYou />} />
      <ProtectedRoute path="/tour/search" element={<SearchResultList />} />
      <ProtectedRoute path="/adminHome" element={<AdminHome />} />
      <ProtectedRoute path="/users" element={<Users />} />
      <ProtectedRoute path="/toursadmin" element={<Toursadmin />} />
      <ProtectedRoute path="/bookings" element={<Bookings />} />
      <ProtectedRoute path="/userbookings" element={<Userbookings />} />
      <ProtectedRoute path="/profile" element={<Profile />} />
    </Routes>
  );
};

export default Router;
